***CASE BEING HEARD BY BRANCH 02 FOR BRANCH 07***

AMENDED Information submitted.  Defense counsel acknowledged receipt of a copy of the Amended Information, waived its reading and entered a plea of not guilty on behalf of the defendant.

Defendant prepared to enter change of plea.  Hearing proceeded.  Negotiations set forth by the state.


AS TO COUNTS 1, 2, 3, AND 4 OF AMENDED INFORMATION:  The defendant was advised of his constitutional rights and maximum penalties, waived all rights, plead GUILTY and was examined as to the plea.  Plea Questionnaire/Waiver of Rights, Addendum to Plea Questionnaire, and Jury Instructions received and filed.  The parties stipulate to the complaint as a factual basis for the plea.  The Court found the defendant guilty and ordered entry of Judgment of Conviction.  

Parties prepared to proceed to sentencing.  Statements made by the state, defense, and defendant.

The Court finds the state in compliance with victim rights legislation.  The Court orders restitution set at zero.

The Court orders the defendant to serve the following:

COUNTS 1 AND 2:  9 MONTHS in the House of Correction, Consecutive to each other with 0 days credit.

COUNT 3:  58 DAYS in the House of Correction with 58 days credit, TIME SERVED DISPOSITION PER THE COURT.

COUNT 4:  60 DAYS in the House of Correction, Concurrent to Counts 1 and 2 with 0 days credit.


AS TO COUNTS 1, 2, AND 4: The Court orders these sentences IMPOSED AND STAYED and orders the defendant to serve 2 YEARS OF PROBATION.

CONDITIONS OF PROBATION:
1) AS TO COUNT 4 ONLY:  Serve 60 DAYS in the House of Correction - STAYED for use at discretion of department of corrections;
2) Obtain an AODA assessment and successfully complete follow-up treatment; 
3) Maintain absolute sobriety- submit to random urine screens;
4) Obtain sex offender evaluation- cooperate with any recommended treatment; 
5) Participate in Batters Intervention program;
6) Pay all applicable mandatory costs, fees, surcharges and assessments;
7)AS TO COUNTS 2 AND 3 ONLY : Pay $100.00 domestic abuse assessment as to each count;
8)NO Contact with victim T.T.T. unless written request to lift order approved;

The Court orders the defendant to pay all court ordered financial obligations by the end of probation period or balance to convert to civil judgment.  Defendant advised of right to appeal this sentence.

